import React from 'react';
import './Home.css';

function Profile() {
    return (
        <div>
            <div className="ContainerT">
                <h1 className="Title1"> Profile </h1>
            </div>
            <div className="ContainerT">
                <h2 className="Title2"> Preferences </h2>
            </div>
          

        </div>
    );
}

export default Profile;
